INSERT INTO eZRfp_Rfp VALUES (3,'Features in eZ publish 2.2','<?xml version=\"1.0\"?><rfp><generator>qdom</generator>\n<intro>eZ publish version 2.2 offers great improvements since version 2.1. The highlights include: PostgreSQL support, template based tags in eZ rfp and eZ trade, user defined rfp/trade tags, dynamic form creation, support for media files ( flash, quick time, mpeg etc ) and section support.</intro><body><page><header level=\"1\">Full changelog since 2.1</header>\r\n<bullet>\r\nAdded support for radiobuttons, checkboxes, dropdown lists and multiple choice lists\r\nSearch in contact now searches in online addresses and phone numbers\r\nFixed Bug count, bug archive on user side.\r\nFixed Bulkmail user login\r\nAdded sections to eZ trade\r\nAdded a better VAT system i eZ trade\r\nAdded voucher view\r\nAdded order list/view for customers\r\nAdded a more complete cart and checkout\r\nAdded SQL admin in sitemanager\r\nAdded fulltext search in eZ forum\r\nFixed search on keywords in rfp\r\nAdded basic editor for templates in admin.\r\nAdded customer list and customer details in eZ trade.\r\nAdded support for multiple keywords in url translator.\r\nAdded section support with Sitedesign, Template and Language override.\r\nFixed problems with rfps being stored with invalid XML\r\nAdded topic link from rfp list and rfp view\r\nAdded modification sorting on rfp categories.\r\nAdded image caption override tag\r\nAdded better search in eZ rfp. Now handles stop words and word freqyency.\r\nFixed problems with searching in eZ filemanager\r\nAdded setting to set if a user can see the calendar of every user\r\nAdded setting to mage consultations visible for everyone\r\nAdded posibility to add an appointment for an entire day in the calendar\r\nAdded setting to make consultations visible for everyone\r\nAdded upload permission setting to eZ filemanager folders and eZ imagecatalogue categories.\r\nAdded buttons for buy and file folder in person/company list\r\nAdded display of which rfps/products an image is used in\r\nAdded mime types for known office documents in filemanger\r\nAdded copy of rfp categories in admin\r\nAdded topic list on user site\r\nAdded search in eZ imagecatalogue\r\nAdded support for IP or Cookie based vote checking in eZ poll\r\nAdded support for custom defined rfp tags in site.ini\r\nAdded XML generator/renderer support in eZ trade\r\nAdded circular categories in eZ rfp\r\nAdded option for keeping case of manual keywords for eZ rfp\r\nAdded support for changing message limit in eZ forum and eZ mail\r\nAdded Signature in eZMail, fixed Preview button bug.\r\nAdded auto check mail, show unread mail features in eZMail (user configurable)\r\nAdded caching in eZ calendar\r\nAdded next/previous in file list in eZ filemanager\r\nAdded vouchers to eZ trade\r\nAdded support for editors group in eZ rfp\r\nAdded new module eZ mediacatalogue; handles flash, movies etc..\r\nAdded override system for rfp list and rfp view templates.\r\nAdded discussion to polls\r\nMoved preamble/header/footer to one file.\r\nAdded support for PostgreSQL and Informix\r\nAdded cache control in site manager ( possibility to clear cache )\r\nAdded site.ini editing under site manager\r\nAdded custom php/html file upload/edit in sistemanager\r\nAdded possibility to override sender info when sending bulkmails with settings in site.ini\r\nAdded mail to friend script\r\nAdded time un/publising on eZ rfp\r\nAdded site map and special front page in eZ rfp (user site)\r\nAdded dynamic generation of site title and meta information.\r\nAdded internal messaging with the module eZ message.\r\nAdded logging on rfps, history of rfp changes.\r\nAdded author list and author select on eZ rfp.\r\nAdded topic to eZ rfp.\r\nAdded attributes to eZ rfp.\r\nAdded eZ quiz module.\r\nAdded eZ form module.\r\nFixed timeout problem in bulkmail loop to avoid time outs when sending e-mails</bullet></page></body></rfp>',1,'',1,1003329949,1003249288,1003249289,1,1,'qdom eZ publish version 2.2 offers great improvements since 2.1. The highlights include: PostgreSQL support, template based tags in eZ rfp and trade, user defined rfp/trade tags, dynamic form creation, support for media files ( flash, quick time, mpeg etc ) section support.Full changelog 2.1   Added radiobuttons, checkboxes, dropdown lists multiple choice lists Search contact now searches online addresses phone numbers Fixed Bug count, bug archive on side. Fixed Bulkmail login Added sections to trade Added a better VAT system i voucher view Added order list/view customers Added more complete cart checkout Added SQL admin sitemanager Added fulltext search forum Fixed keywords rfp Added basic editor templates admin. Added customer list details trade. Added url translator. Added with Sitedesign, Template Language override. Fixed problems rfps being stored invalid XML Added topic link from modification sorting categories. Added image caption override tag Added rfp. Now handles stop words word freqyency. Fixed searching filemanager Added setting set if can see the calendar of every user Added mage consultations visible everyone Added posibility add an appointment entire day calendar Added make upload permission filemanager folders imagecatalogue buttons buy file folder person/company list Added display which rfps/products is used in Added mime types known office documents filemanger Added copy categories admin Added site Added imagecatalogue Added IP or Cookie vote checking poll Added custom site.ini Added XML generator/renderer circular option keeping case manual changing message limit forum mail Added Signature eZMail, fixed Preview button bug. Added auto check mail, show unread mail features eZMail (user configurable) Added caching next/previous vouchers editors group new module mediacatalogue; movies etc.. Added view templates. Added discussion polls Moved preamble/header/footer one file. Added Informix Added cache control site manager possibility clear ) Added site.ini editing under manager Added php/html upload/edit sistemanager Added sender info when sending bulkmails settings friend script Added time un/publising map special front page site) Added generation title meta information. Added internal messaging message. Added logging rfps, history changes. Added author select rfp. Added attributes quiz module. Added module. Fixed timeout problem bulkmail loop avoid outs e-mails ',0,0,0,0,'');
