pecial characters link XHTML, XML or similiar you can use the <bold>pre</bold> tag.\r\n\r\n<pre>\r\n&lt;xml&gt;\r\n&lt;item attr=\"foo\"&gt; bar &lt;/item&gt;\r\n&lt;/xml&gt;\r\n</pre>\r\n</page></body></rfp>',1,'',1,1003318302,1003251862,1003251888,1,1,'qdom This rfp will show some of the more advanced eZ publish renderer functionality. Custom HTML tags   Note: It\'s not recommended to use html tags if you plan export contents another format ( PDF soon be available in publish ). You should rather define your own done site.ini ).    &lt;h2&gt;This is an example inside rfp&lt;/h2&gt; Here can do &lt;font color=\"#559955\"&gt;whatever&lt;/font&gt; want.    Lorem ipsum dolor sit amet, consectetaur adipisicing elit, sed eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi aliquip ex ea commodo consequat. Duis aute irure reprehenderit voluptate velit esse cillum eu fugiat nulla  pariatur. Excepteur sint occaecat cupidatat non proident, sunt culpa qui officia deserunt mollit anim id est laborum Et harumd und lookum like Greek me, dereud facilis er expedit distinct    Lorem distinct   Showing code If want write a technical with special characters link XHTML, XML or similiar pre tag.    &lt;xml&gt; &lt;item attr=\"foo\"&gt; bar &lt;/item&gt; &lt;/xml&gt;    ',0,0,0,0,'');
